import React from 'react'
import ReactDOM from 'react-dom'

const Hello = (para) => {
  return (
    <div>
      <p>Hello {para.name} age={para.age}</p>
    </div>
  )
}

const App = () => {
  const age= 10
  return (
    <div>
      <h1>Greetings</h1>
      <Hello name="Georgie" age={26+5}/>

      <Hello name="Daisy" age={age}/>
    </div>
  )
}
ReactDOM.render(<App />, document.getElementById('root'))
